import React from 'react'
import { withFavoritesContext } from "./Favorites"
import Loading from './Loading';
import Idle from "./Idle"
import Error from "./Error"


function FavoritesList({favorites, idle, loading, err}) {
    console.log(favorites)
    const favElements = favorites.map(favorite => (
        <div key={favorites._id}>{favorite.title}</div>
    ))
    return (
    <Idle idle={idle}>
        <Loading loading={loading}>
            <Error err={err}>
                {favElements}
            </Error>
        </Loading>
    </Idle>
    )
}

export default withFavoritesContext(FavoritesList)
